# Function to remove non-ASCII (Unicode) characters
def remove_unicode(text):
    return text.encode('ascii', 'ignore').decode()

# Read the input text file
with open('input.txt', 'r', encoding='utf-8') as file:
    text = file.read()

# Remove any Unicode characters from the text
clean_text = remove_unicode(text)

# Save the cleaned text to a new file
with open('output.txt', 'w', encoding='ascii') as file:
    file.write(clean_text)

print("Text file saved without Unicode characters.")


import pandas as pd

# Read the Excel file into a DataFrame
df = pd.read_excel("your_file.xlsx")

# Initialize an empty list to store the formatted text rows
text_rows = []

# Iterate through each row in the DataFrame
for index, row in df.iterrows():
    # Combine all columns in the row, converting to strings and separating them with a delimiter (like a tab or space)
    combined_row = ' | '.join([str(value) for value in row.values])
    
    # Append the combined row to the list
    text_rows.append(combined_row)

# Join all rows into a single text block, separated by newline characters
text_based_table = '\n'.join(text_rows)

# Print or save the text table for later use
print(text_based_table)

# Optionally, you can save the text-based table to a file
with open("output_table.txt", "w") as f:
    f.write(text_based_table)


import base64
import vertexai
from vertexai.generative_models import GenerativeModel, Part, SafetySetting, FinishReason
import vertexai.generative_models as generative_models


def generate():
  vertexai.init(project="nplcloudfunc", location="us-central1")
  model = GenerativeModel(
    "gemini-1.5-pro-001",
  )
  responses = model.generate_content(
      [image1, text1],
      generation_config=generation_config,
      safety_settings=safety_settings,
      stream=True,
  )

  for response in responses:
    print(response.text, end="")

image1 = Part.from_data(
    mime_type="image/png",
    data=base64.b64decode(""""""))
text1 = """Extract all elements in json format along with the elements in table and from whom the invoice is generated and terms and conditions. Then summarize all the information in the form of bullet points without loosing any critical data."""

generation_config = {
    "max_output_tokens": 8192,
    "temperature": 1,
    "top_p": 0.95,
}

safety_settings = [
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_HATE_SPEECH,
        threshold=SafetySetting.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE
    ),
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT,
        threshold=SafetySetting.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE
    ),
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT,
        threshold=SafetySetting.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE
    ),
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_HARASSMENT,
        threshold=SafetySetting.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE
    ),
]

